<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;楽天スーパーSALE&nbsp;&gt;&nbsp;SALE対象ledライト・照明

タッチパネルで簡単に7段階調光
一目で<br>わかるタッチパネル式操作で、<br>
力を入れてボタンを押す必要なく、<br>
電源のON/OFFやスライド長押して、<br>
場面に合わせた7段階の細かな光の加減を簡単に調整。<br>
<br>
本製品4つの特徴<br>
・スタイリッシュなセードカバー<br>
・セードをたたんで間接照明にも<br>
・ワイドな150°の開閉が可能<br>
・簡単タッチパネル操作で7段階調光<br>

84粒のＬＥＤチップ<br>
84粒のＬＥＤチップを組み合わせて光を<br>重ねることで高い照度を実現。<br>

サイズ：約H460×W180×D180mm<br>
重さ：1626g<br>
電源：AC100V　50Hz/60Hz<br>
消費電力9W<br>
コード長：約2.4m<br>
光源：LED（7段階調光）<br>
光色：白昼色<br>
光束：800Lm<br>
素材：ABS<br>
角度調整：150°<br>
