メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
USBフレキシブルミニライト<br>
<br>
USBに接続するだけのカンタン操作<br>
パソコンや車だけでなくモバイルバッテリーを使えばおでかけ先でも使える！<br>
ミニサイズでポケットやポーチにも入る<br>
LEDで明るく便利！<br>
<br>
【特徴】<br>
・LED光源の明るいUSBライト<br>
・薄型・ミニサイズでポーチにも入る。<br>
・お家や車、外でも使える便利なライト。<br>
・360°自由自在なフレキシブルアーム<br>
・ホワイト・ピンク・ブルー・グリーン・オレンジの全5色展開<br>
<br>
USBライトに小さくておしゃれなライトが登場！<br>
電源いらずのUSBライトはお手持ちのUSB対応機器に接続するだけでカンタンにライトがON!<br>
パソコンやモバイルバッテリー、シガーソケットでも使用できるので、いつでもどこでもすぐに使えて便利！<br>
スリムでコンパクトなサイズなので、厚さは約9mmと薄型で長財布より小さいので、<br>
ポーチやポケットにすっぽり入ります。<br>
<br>
規格<br>
サイズ：約H169×W18×D9mm<br>
重さ：約16g<br>
電圧：5V<br>
消費電力：約1.2W<br>
光源：LED<br>
素材：シリコン<br>
