<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;デスクライト&nbsp;&gt;&nbsp;LED

クリアのアクリルをシンプルに曲げたLEDデスクライト<br>
ボタンをタッチで、3パターンの明かりを演出！<br>
<br>
厚さ8mmのアクリル板をシンプルに曲げたデザイン。<br>
つぎ目がないので透明感のある光の演出が楽しめる。<br>
台座がタッチ式操作パネルになっており、指で触れることで、仕事や勉強モード、リラックスモード、アクティブモードを選ぶことができる。<br>
LEDチップは18粒で白熱灯60ワット相当の明るさを実現する。<br>
省エネ設計で消費電力は蛍光灯の約4分の1。<br>
重さは400gと軽量。<br>
<br>
【仕様】 <br>
■サイズ：160×265×320mm<br>
■定格電圧：100V<br>
■光源：LEDチップ18粒<br>
■消費電力：最大２W<br>
■電源コード：約２m<br>
【付属品】：本体×１、ACアダプター×１、取扱書/保証書×１<br>
