<tr>
<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ブランドで選ぶ&nbsp;&gt;&nbsp;LED照明&nbsp;&gt;&nbsp;LED DECO LIGHT デコライト

【LED DECO LIGHT 001】<strong>LEDデスクライト</strong><br>
オシャレな LED デスクライト<br>
３段調光目に優しい 電気スタンド卓上ライト♪<br>
灯具を自由に動かせる使い勝手の良いスタンド、 <br>
家庭用コンセントに、本体に付属している<br>
コードを差し込むだけで設置簡単、<br>
LEDライトなので省電力で長寿命！<br>
電気代を気にせずに長時間使えます。<br>
<br>
【特徴】<br>
・直接照明としても間接照明としても使えます<br>
・３段階の調光<br>
・シンプルなデザイン<br>
・軽く触れるだけでON/OFFができるタッチスイッチ（タッチセンサーライト）<br>
・LED電球は省エネ長寿命<br>
・消費電力は、わずか2.8W<br>
<br>
省電力で長寿命の白色LEDを14個搭載した<br>デスクライト LED<br>
触れるだけでON/OFFができるスイッチレスの<br>スタンドライトです。<br>
タッチセンサーを搭載しているので<br>シンプルなデザインに仕上がりました。<br>
３段階の明るさの調整も可能！<br>
白熱電球や電球型蛍光灯よりも断然オススメ！<br>
<br>
アームにより、ライトの高さ・角度の調整が自由自在です。<br>
フレキシブルな構造でとても使いやすく設計されてます。<br>
コンパクトに収納も可能になりました。<br>
<br>
自宅でも会社でもお店でも！<br>シンプルでモダンなデザインが大人気！<br>
土台は薄型でもしっかりと支えてくれます。<br>
パソコンにも読書にも、しっかり明るく照らしてくれます。<br>
自然光に近い明るさは子供にも大人にもやさしい灯り。<br>
学習机やデスクワークにもオススメです。<br>
プレゼントにも最適ですね♪<br>
<br>
土台部分の裏面はクッション素材になっていて、<br>接地面にも優しい設計に。<br>
さらに、滑りにくい素材になってます。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
規格<br>
定格電圧：100～240V <br>
調光：3段階<br>
光源：LEDチップ0.2W×14粒 <br>
光色：昼白色（5000～6500K） <br>
光通量：330LM<br>
消費電力：2.8W <br>
電源コード：約１ｍ<br>
重さ：700ｇ<br>
<br>
注意事項<br>
・光源を直視しないでください。<br>目に悪影響を及ぼす恐れがあります。<br> 
・ラジオ、テレビや赤外線リモコン方式の機器から離してご使用ください。<br>雑音が入ったり、正常に動作しない場合があります。 <br>
・LED光源にはバラツキがあるため、<br>同じ形名商品でも商品ごとに発光色、<br>明るさが異なる場合がありますのでご了承ください。<br>
【販売元】<br>
大河商事 株式会社<br>
