<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;ネイル LEDライト

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser18】wasser LED充電式デスクライト<br>
<br>
wasserシリーズ初！<br>
時計、アラーム・スヌーズ機能がついた液晶パネル付きデスクライト。<br>
タッチボタンで3段階調光が可能。<br>
充電式なので持ち歩きができて便利。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
学習机や読書、オフィスにもピッタリ。<br>
※付属のボタン電池はテスト用です。<br>
<br>
【特徴】<br>
・3段階調光ができる充電式デスクライト。<br>
・軽く触れるだけでON/OFF/3段階調_光が出来るタッチボタン。<br>
・ボタン電池式の時間・年月日・曜日・温度表示付き液晶ディスプレイ。<br>
・約2.5時間のUSB充電で約2～6時間（使用する機能によります）使用できます。<br>
・便利なアラーム・スヌーズ機能と8種類のアラーム音。<br>
・ナイトライトでライトの底部が赤色または7色のグラデーションで発光。<br>
・省エネ、長寿命なLED使用。<br>
・面発光のLEDでLEDチップの光が直接当たらないので目に優しくて安心。<br>
・消費電力は最大約4W。<br>
<br>
お客様のご要望にお応えして、wasserシリーズに液晶ディスプレイ付きのデスクライトが登場<br>
3段階の明るさでお好みの明るさを調節していただけます。<br>
コンパクトなデザインなので、お子さまのお部屋やネイル、寝室のサイドテーブルなどにもピッタリ。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
重さは約380gなので持ち運びも簡単。<br>
折りたたみ、持ち運びができて場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
